import React from "react"

interface RunSimulationProps {
	run: boolean,
	handleRunEvent: () => void,	
}

const RunSimulation: React.FC<RunSimulationProps> = ({ run, handleRunEvent }) => {
	const name = run ? "Stop" : "Run";
	return (
		<div>
			<button className="control-button" onClick={() => handleRunEvent()}>
				{name}
			</button>
		</div>

	);
}

export default RunSimulation;
